import React from 'react';
import LineGraph from '../components/LineGraph';

function MainPage() {
  // Add static data here
  const staticData = [
    { name: 'January', value: 12 },
    { name: 'February', value: 15 },
    { name: 'March', value: 20 },
  ];

  return (
    <div>
      <h1>Main Page</h1>
      <div>
        {/* Add grid layout here */}
      </div>
      <LineGraph data={staticData} />
    </div>
  );
}

export default MainPage;
